import styled from "styled-components";

export const Container = styled.div`
  width: 100%;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #ffcfcd;
  margin: 1rem 0;
`;

export const Form = styled.form`
  width: 40%;
  height: 100vh;
  background-color: #fff;
  display: flex;
  flex-wrap: wrap;
`;
